text:
조승우 배우님의 무대 장악력에 감탄하다가 온 뮤지컬입니다
노래면 노래 연기면 연기 심지어 유머까지 삼 박자가 딱딱 맞더군요
조배우님의 헤드윅 연기 너무 흥미롭고 재미있게 보다가 왔습니다 &#10084;

헤드윅은 정말 한번만 볼 수가 없는 뮤지컬 ㅠㅠ
추석연휴의 시작으로 너무 즐거웠어요
렌드윅과 려츠학 &#128149;

피켓팅을 뚫고 드디어 영접한 조드윅의 가슴벅찬 후기..

&#8203;

한 네 번 시도했던 것 같습니다. 조승우님의 헤드윅을 티켓팅 하기위해.. 겨우겨우 1층!! 중블 뒷쪽으로 티켓팅에 성공해서 오늘 마티네 공연으로 조드윅 영접하고 왔습니다.

&#8203;

원래도 영화 헤드윅의 철학과 음악, 배우, 영상 등 모든 면에서 헤드윅을 좋아하던 사람으로서 오늘 공연은 정말 영접이란 단어를 사용할 정도로 전율이 오고 행복하면서 감동적인 최고의 뮤지컬(?) 공연이 아니었나 싶었습니다.

&#8203;

오늘 공연을 보며 마음속에 떠오른 키워드가 몇 가지 있는데요.

&#8203;

1) 뮤지컬 공연이 아닌 실제 헤드윅 콘서트 직관!!

2) 영화에 나오지 않았던 비하인드 스토리

3) 최신 가요 트렌드를 접목한 영리한 콘서트

4) 개그맨인가 가수인가 배우인가? 조승우의 엄청난 개그감과 노래실력!!

5) 조드윅보다 눈길이 가고 귀를 기울이게 만든 율츠학. 유리아!!

6) 인터미션 없이 3시간동안 혼자 떠들고 노래하고 개그하며 관객을 끝까지 집중하게하고 끝까지 멱살잡고 끌고가는 조드윅 그는 신인가? 인간인가?

&#8203;

정도랄까요..

&#8203;

전 처음 조드윅이 오른쪽 관객석 뒤에서 입장할 때부터 묘한 감정이 들었습니다. 그러고 첫곡 tear me down 을 부르고나서 뒤늦게 입장하는 관객들을 보며 콧바람 흥흥대면서 툴툴대던 조드윅을 보며 ''아.. 이거 뮤지컬이 아니라 헤드윅 콘서트구나!'' 라고 인식하게 되었죠. 그 순간 전 단순히 뮤지컬을 보러 온 관객이 아닌 진짜 헤드윅 세계관에 들어와서 헤드윅의 폐차장공연을 보고 그녀의 넋두리를 들어주는 한 명의 팬이 되어 함께 그들과 호흡하고 있었습니다.

&#8203;

제게 이건 정말 굉장하고 특별한 첫경험이었습니다. 자연스레 3시간동안이나 그녀의 모놀로그에 더욱더 집중하며 귀기울이게 되었고 그녀의 스토리에 진심으로 울림을 받으며 공연에 빠져들 수 있었죠. 너무도 마법같은 3시간이었답니다.

&#8203;

영화에선 다루지 않았던 이츠학과 헤드윅의 첫 만남의 스토리나 그녀가 어쩔 수 없이 행했던 매춘에 대한 본인의 생각, 그리고 이츠학이나 토미에 대한 진심어린 고백 등 새롭게 알게되고 더욱더 빠져들게 되는 포인트들도 많았어요.

&#8203;

제가 그 전의 헤드윅 공연은 보지 못해서 모르겠지만 이번 공연에선 제가 좋아하는 이날치의 범내려온다를 공연에서 선보이기도 하고 또 인터넷에 많이 퍼져있는 다양한 밈, 예를 들어 "개 짖는 소리좀 안나게하라" 라던가 휘성 성대모사, 안알랴줌 등등 공감하며 빵 터지게하는 다양한 개그포인트가 많았는데 이를 너무도 완벽하게 마치 개그맨처럼 살린 조승우님 정말 대단했습니다.

&#8203;

그리고 전 유리아 님의 공연은 이번이 처음이었는데 정말 깜짝 놀랐네요. 너무 노래 잘하셔서!! 이 공연에서 이츠학은 사실 연기보단 노래에 초점이 맞춰진 케릭터인데 정말 초고음까지 너무도 완벽하게 왠만한 탑가수 그 이상으로 노래를 잘하셔서 정말 깜짝 놀랐어요. 거기다 170의 큰 키에 다리가 어찌나 길고 얇으시던지.. 몸매가 진짜..와.. 정말 새로운 보석의 발견한 것 같은 기분이었습니다.

&#8203;

공연을 다 보고 나오니 거의 3시간이나 지났더라구요. 공연 시작 전에는 안내판에는 공연시간이 2시간 10분으로 나와있었고 안내하시는 분들은 2시간 40분간 진행될거라고 하더니.. 그 두 정보를 다 무시하고 무려 인터미션없이 3시간이나 공연이 진행되었더군요.

&#8203;

근데 이 공연 모놀로그에요 헤드윅 혼자 나와서 이런저런 넋두리 늘어놓으며 자기 얘기 하고 그러다 노래 하고 그게 다인데 그걸 3시간이나 전혀 지루할틈없이 완벽히 몰입시키면서 공연을 하시더라구요. 조승우님이!! 정말 최고였습니다. 제 최고의 공연은 지금까진 위키드였는데 오늘부터 바꾸려구요. 조승우의 헤드윅으로.

&#8203;

마지막으로 헤드윅 공연의 진짜 이야기인 헤드윅 슈미츠가 갖고있는 사랑과 삶에 대한 철학을 이야기 하고자 하는데. 사실 이건 너무 호불호가 갈리고 논쟁이 될 부분이 많은것 같아요. 헤드윅 원작자인 존 카메론 미첼 본인 부터가 일단 게이시고 그간 다뤘던 그의 작품들이 성적으로나 철학적으로 굉장히 트여있고 다양성을 존중하시는 분이거든요.

&#8203;

그래서 아마 게이, 레즈비언, 트렌스젠더, 드랙퀸 등 성소수자에 대해 좀 반감이 있거나 하시는 분들은 공연 보기 많이 부담스럽거나 이해하기 힘드실 수 있어요. 메인 테마송인 Origin of Love부터가 인간은 애초에 남자남자, 여자여자, 남자여자인 존재들이 신의 노여움으로 갈라져 인간이 되었다는 설정을 이야기 하니까요. 그만큼 원작자의 생각에 성소수자들은 자연스러운 존재라는 것이겠죠.

&#8203;

그리고 기독교, 예수님에 대한 이야기도 가볍게 다루기도 하고 공연철학이 굉장히 대중적이지 못한 작품이죠. 헌데 개인적으로 전 원작자의 철학과 제 생각이 어느정도 동일 선상에 놓여있기도 하고 모든 개인의 자유나 생각, 취향을 존중하는 사람으로서 어느하나 거슬리지 않고 즐겁게 볼 수 있었습니다.

&#8203;

이런저런 작품에 대한 이야기를 맥락없이 늘여놓았는데요.. 아무튼 제 요지는 헤드윅.. 아니 조드윅은 정말 최고였으며 너무 감동먹었다는 이야기였습니다 ㅎㅎ

조승우님의 헤드윅 보실 수 있으면 꼭 보시길!!
